import { Grid, Paper } from "@mui/material"
import { height } from "@mui/system";
import ERoller from '../IMGs/E_Roller.jpg';

const AppCard = () => {
    return(
        <Grid item sx={12}>
            <Paper elevation= {7} >
                <img src={ERoller} alt="Roller" sx={{width:"50px", height:"100%"}} />
            </Paper>
        </Grid>
    )
}

export default AppCard;
